import "bootstrap/dist/css/bootstrap.min.css";

const InputTask = () => {
  return (
    <div className="card">
      <div className="card-body">
        <h5 className="card-title">Add Todo</h5>
        <form>
          <div className="form=group">
            <label htmlFor="EnterTodo">Type your Next Todo</label>
            <input id="EnterTodo" type="text" />
            <br />
          </div>
          <br />
          <input type="submit" className="btn-sm btn-primary" />
        </form>
      </div>
    </div>
  );
};
export default InputTask;
